WalkingVest is available in different sizes, all for users weighing max 300 kg/660 lbs.
<ul>
 	<li>Easy for the caregiver to apply</li>
 	<li>Designed for greater safety and security during gait training</li>
 	<li>Provides good support in the groin and around the upper body</li>
 	<li>SWL 300 kg/660 lbs</li>
</ul>
<div>
Accessories for individual adaptation are available.</div>
